import { Button, Drawer, Form, Input } from "antd";
import React, { PureComponent } from "react";

export default class AddUser extends PureComponent {
  render() {
    return (
      <Drawer
        // onClose={this.props.onDrawerClose()}
        placement="right"
        title="Add User"
        open={this.props.openDrawer}
      >
        <Form layout="vertical">
          {this.props.userDetails.map((details) => {
            return (
              <Form.Item label={details.key}>
                <Input placeholder={details.value} />
              </Form.Item>
            );
          })}
          <Form.Item>
            {/* <Button type="primary" onSubmit={this.props.onFormSubmit()}>
              Submit
            </Button> */}
          </Form.Item>
        </Form>
      </Drawer>
    );
  }
}
